	public void killScript(String err){
		RUN = false;
		if(!err.isEmpty())
			General.println(err);
		loginHandler.logout(false);
	}
	
	private boolean checkInv(){
		BackpackItem items[] = Backpack.find(BONES);
		BackpackItem tp[] = Backpack.find(TELE_TAB);
		return items != null && items.length > 0 && tp != null && tp.length > 0;
	}
	
	private boolean checkInvBonesOnly(){
		BackpackItem items[] = Backpack.find(BONES);
		return items != null && items.length > 0;
	}
	
	private boolean findBank(){
		BankItem bones[] = Banking.find(BONES);
		BankItem tele[] = Banking.find(TELE_TAB);
		BankItem marrentill[] = Banking.find(MARRENTILL);
		if(bones == null || tele == null || marrentill == null)
			return false;
		return bones.length > 0 && tele.length > 0 && marrentill.length > 0;
	}
	
	private boolean checkNoSuppliesMsg(){
		Dimension d = Screen.getDimension();
		Point chatboxDTMs[] = DTMs.find_simple(DTMHandler.getWorldChatDTM(), 0, 0, d.width, d.height);
		if(chatboxDTMs.length == 0)
			return false;
		TextChar temp[] = Text.findCharsInArea(chatboxDTMs[0].x, chatboxDTMs[0].y, 290, 190, true);
		if(temp.length == 0)
			return false;
		ArrayList<TextChar[]> lines = Text.splitByHorizontalLines(temp);
		for(TextChar line[] : lines){
			if(line == null)
				continue;
			String lineStr = Text.lineToString(line, 3).toLowerCase();
			if(lineStr.contains("item could not be found"))
				return true;
		}
		return false;
	}
	
	private void lightIncenseBurners(){
		int count = 0;
		CameraHandler.rotateToChapel();
		boolean first = false;
		BackpackItem bones[] = Backpack.find(BONES);
		if(bones != null)
			bonesCount = bones.length;
		while(burnerBool()){
			if(count++ == MAX_FAILURES){
				killScript("Incense burners lighting took too long. Killing script.");
				break;
			}
			Filter<ScreenModel> burnerFilter = new BurnerFilter();
			final ScreenModel burners[] = ScreenModels.findNearest(burnerFilter);
			BackpackItem items[] = Backpack.find(MARRENTILL);
			if(burners.length < 1 || items.length < 1)
				break;
			final int mAmount = items != null ? items.length : 0;
			if(!first){
				if(ClickHandler.rightClickScreenModel(burners[0], LIGHT_OPTION)){
					first = true;
					Timing.waitCondition(new Condition(){
						public boolean active(){
							BackpackItem items[] = Backpack.find(MARRENTILL);
							int mAmount2 = 0;
							if(items != null)
								mAmount2 = items.length;
							return !burnerBool() || mAmount != mAmount2;
						}
					}, General.random(6000, 7000));
				}else
					General.sleep(900, 1350);
			}else{
				if(ClickHandler.clickScreenModel(burners[0], LIGHT_OPTION)){
					Timing.waitCondition(new Condition(){
						public boolean active(){
							BackpackItem items[] = Backpack.find(MARRENTILL);
							int mAmount2 = 0;
							if(items != null)
								mAmount2 = items.length;
							return !burnerBool() || mAmount != mAmount2;
						}
					}, General.random(6000, 7000));
				}else
					General.sleep(900, 1350);
			}
		}
	}
	
	private boolean burnerBool(){
		BackpackItem items[] = Backpack.find(MARRENTILL);
		return items != null && items.length > 0;
	}
	
	private boolean prayCycle(){
		if(burnerBool()){
			if(++marrentillFailures == MAX_FAILURES){
				killScript("ERROR: Too many successive marrentill failures. Killing script.");
				return false;
			}
			General.println("Started pray cycle while still having marrentil! Protect the bones!");
			lightIncenseBurners();
			return false;
		}
		marrentillFailures = 0;
		Filter<ScreenModel> chapelFilter = new ChapelFilter();
		final ScreenModel chapel[] = ScreenModels.findNearest(chapelFilter);
		if(chapel.length < 1){
			killScript("ERROR: Chapel disappeared? Stopping script.");
			return false;
		}
		ClickHandler.clickScreenModel(chapel[0], OFFER_OPTION);
		General.sleep(1000);
		return Timing.waitCondition(new Condition(){
			boolean isOffering = false;
			public boolean active(){
				performIdleActions();
				if(!isOffering && Player.getAnimation() == OFFER_ANIM_ID)
					isOffering = true;
				if(!isOffering)
					ClickHandler.clickScreenModel(chapel[0], OFFER_OPTION);
				General.sleep(1100, 1400);
				return !checkInvBonesOnly();
			}
		}, General.random(60000, 70000));
	}
	
	private boolean openBank(){
		Filter<ScreenModel> combinedFilter = new BankerFilter();
		final ScreenModel banks[] = ScreenModels.findNearest(combinedFilter);
		if(banks.length == 0)
			return false;
		if(ClickHandler.clickScreenModel(banks[0], BANK_OPTION))
			return Timing.waitCondition(new Condition(){
				public boolean active(){
					General.sleep(300, 400);
					return Banking.isBankScreenOpen() || Banking.isPinScreenOpen();
				}
			}, General.random(1500, 2000));
		else
			return false;
	}
	
	private boolean bank(){
		if(!Banking.isBankScreenOpen() && !Banking.isPinScreenOpen())
			if(!openBank())
				return false;
		if(Banking.isPinScreenOpen()){
			if(solvePin){
				Banking.inPin(pin);
				Timing.waitCondition(pinScreenCondition, General.random(6000, 7000));
			}else{
				killScript("ERROR: No pin available to access bank. Killing script.");
				return false;
			}
		}
		if(!findBank()){
			killScript("No more supplies left. Killing script.");
			return false;
		}
		Keyboard.pressKeys('1');
		if(checkNoSuppliesMsg()){
			killScript("No more supplies left. Killing script.");
			return false;
		}
		return Timing.waitCondition(new Condition(){
			public boolean active(){
				return checkInv();
			}
		}, General.random(250, 500));
	}
	
	private void clickCompass(){
		Dimension d = Screen.getDimension();
		DTM compassDTM = DTMHandler.getCompassDTM();
		int failCount = 0;
		while(DTMs.find_simple(compassDTM, 0, 0, d.width, d.height).length == 0){
			if(++failCount == MAX_FAILURES){
				killScript("ERROR: Compass not found. Killing script.");
				return;
			}
			General.sleep(125, 175);
		}
		failCount = 0;
		while(!compassDTM.click((String[])null, new Point(22, 23), null)){
			if(++failCount == MAX_FAILURES)
				break;
			General.sleep(200, 275);
		}
		Point p = Mouse.getPos();
		Mouse.moveBox(p.x - 50, p.y - 50, p.x - 20, p.y - 20);
	}
	
	public void performIdleActions(){
		if(xpHandler != null)
			xpHandler.setCurrentVars(false);
		if(antiBan == null)
			return;
		status = "Idling";
		antiBan.checkXP(Skills.SKILLS.PRAYER);
		if(!antiBan.isOpenBackpack())
			antiBan.openBackpack();
		antiBan.checkRandomObject();
		antiBan.rotateCam(false);
		antiBan.leaveGame();
		antiBan.pickUpMouse();
		antiBan.randomMouseMovement();
		antiBan.randomRightClick();
	}
	
	private boolean marrentillCheck(){
		BackpackItem items[] = Backpack.find(MARRENTILL);
		return items != null && items.length > 2;
	}
	
	private boolean tpToHouse(){
		if(marrentillCheck()){
			killScript("ERROR: More than 2 marrentill found! Killing script.");
			return false;
		}
		BackpackItem tp[] = Backpack.find(TELE_TAB);
		if(tp == null || tp.length < 1)
			return false;
		tp[0].click();
		return Timing.waitCondition(new Condition(){
			public boolean active(){
				return LocationHandler.isAtHouse();
			}
		}, General.random(5000, 6000));
	}
	
	private boolean clickBankTele(){
		DTM dtm = DTMHandler.getTzhaarRingDTM();
		return dtm.click((String[])null, new Point(30, 30), null);
	}
	
	private boolean tpToBank(){
		int failures = 0;
		while(!clickBankTele()){
			General.sleep(900, 1200);
			if(++failures == MAX_FAILURES){
				killScript("Failed to teleport to bank. Killing script.");
				break;
			}
		}
		Timing.waitCondition(new FightCaveTeleCondition(), General.random(2000, 3000));
		Keyboard.pressKeys('3');
		return Timing.waitCondition(new Condition(){
			public boolean active(){
				General.sleep(50, 100);
				return LocationHandler.isInBank();
			}
		}, General.random(3000, 4000));
	}
	
	private String sanitize(String pin){
		if(pin.length() != 4)
			return "";
		try{
			Integer.parseInt(pin);
		}catch(Exception e){
			return "";
		}
		return pin;
	}
	
	public void setOptions(PrayerGUI gui){
		if(optionsSet)
			return;
		optionsSet = true;
		pin = sanitize(gui.getPin());
		solvePin = gui.solvePin() && !pin.isEmpty();
		boolean enableLogin = gui.enableLogin();
		if(enableLogin){
			String un = gui.getUserName();
			char username[] = new char[un.length()];
			for(int i = 0; i<username.length; i++)
				username[i] = un.charAt(i);
			char pw[] = gui.getPassword();
			char password[] = new char[pw.length];
			for(int i = 0; i<pw.length; i++){
				password[i] = pw[i];
				pw[i] = 0;
			}
			loginHandler = new LoginHandler(enableLogin, username, password);
		}else
			loginHandler = new LoginHandler(enableLogin);
		enableBreakHandling = gui.enableBreakHandling();
		if(enableBreakHandling){
			breakHandler = new BreakHandler(this, gui.getMinBreakStart(), gui.getMaxBreakStart(), gui.getMinBreakLength(), gui.getMaxBreakLength(), gui.getStartOffset(), gui.getLengthOffset(), loginHandler);
			breakHandler.setBreakParams();
		}
	}
	
	private String getRunTime(){
		int times[][] = {{604800, 0}, {86400, 0}, {3600, 0}, {60, 0}, {1, 0}};
		String time_string[] = {"W", "D", "H", "M", "S"};
		int i = 0;
		int time = (int)(runTime / 1000);
		while(time > 0){
			if(time - times[i][0] >= 0){
				times[i][1]++;
				time -= times[i][0];
			}else
				i++;
		}
		String ret = "";
		for(i = 0; i < times.length; i++)
			if(times[i][1] > 0)
				ret += times[i][1] + time_string[i] + (i + 1 == times.length ? "" : " ");
		return ret;
	}
	
	private boolean init(){
		if(loginHandler == null)
			return false;
		if(loginHandler.getState() == LoginState.OUT){
			status = "Logging in";
			if(!loginHandler.login(false))
				return false;
		}
		if(loginHandler.getState() == LoginState.LOBBY){
			status = "Logging in";
			loginHandler.login(true);
		}
		status = "Initializing";
		return loginHandler.getState() == LoginState.IN;
	}
	
	private void initVars(){
		status = "Initializing - XP Check";
		xpHandler = new XPHandler(Skills.SKILLS.PRAYER);
		if(!xpHandler.isUsable())
			xpHandler = null;
		startTime = timeOld = System.currentTimeMillis();
		calcTime = 0;
		antiBan = new IdleActionsHandler();
	}
	
	public void run(){
		buildPaintString();
		final Prayer temp = this;
		EventQueue.invokeLater(new Runnable(){
			public void run(){
				try{
					gui = new PrayerGUI(temp, new WindowAdapter(){
						public void windowClosed(WindowEvent e){
							RUN = false;
						}
					});
					gui.setVisible(true);
				}catch(Exception e){
					e.printStackTrace();
					RUN = false;
				}
			}
		});
		status = "Initializing";
		while(gui == null || gui.isVisible())
			General.sleep(50);
		
		if(RUN){
			General.useAntiBanCompliance(true);
			if(!init())
				return;
			
			Timing.waitCondition(new NoXPStart(), General.random(15000, 17000));
			initVars();
			clickCompass();
			General.sleep(300, 400);
		}
		
		int failCount = 0;
		while(RUN){
			General.sleep(50);

			if(antiBan != null && !antiBan.isOpenBackpack())
				antiBan.openBackpack();
			if(xpHandler != null)
				xpHandler.setCurrentVars(false);
			if(Banking.isPinScreenOpen()){
				failCount = 0;
				if(solvePin){
					Banking.inPin(pin);
					Timing.waitCondition(pinScreenCondition, General.random(6000, 7000));
				}else{
					killScript("ERROR: No pin available to access bank. Killing script.");
					break;
				}
			}
			
			if(LocationHandler.isInBank()){
				failCount = 0;
				if(enableBreakHandling && breakHandler != null)
					breakHandler.handleBreak();
				if(checkInv()){
					status = "Teleporting to the house";
					General.println("Teleporting to the house");
					tpToHouse();
				}else{
					status = "Banking";
					General.println("Banking.");
					bank();
				}
			}else if(LocationHandler.isAtHouse()){
				failCount = 0;
				if(checkInvBonesOnly() && !LocationHandler.isAtChapel()){
					status = "Lighting burners";
					General.println("Attempting to light incense burners.");
					lightIncenseBurners();
				}else if(!checkInvBonesOnly() && LocationHandler.isAtChapel()){
					status = "Teleporting to the bank";
					General.println("Exiting house.");
					bonesOffered += bonesCount;
					bonesCount = 0;
					tpToBank();
					CameraHandler.faceNorth();
				}else{
					status = "Beginning to offer bones";
					General.println("Beginning offer cycle.");
					prayCycle();
				}
			}else{
				General.sleep(125, 150);
				if(++failCount == MAX_FAILURES){
					failCount = 0;
					tpToBank();
					CameraHandler.faceNorth();
				}
			}
		}
	}
	
	public void onPaint(Graphics g){
		if(timeOld > 0){
			long newTime = System.currentTimeMillis();
			calcTime += newTime - timeOld;
			timeOld = newTime;
		}else
			timeOld = System.currentTimeMillis();
		
		if(xpHandler != null){
			long currentXP = (long)xpHandler.getCurrentXP();
			long startXP = (long)xpHandler.getStartXP();
			xph = (int)Math.round((float)(((currentXP - startXP) * 3600000L) / calcTime));
		}
		runTime = System.currentTimeMillis() - startTime;
		
		BufferedImage paintIMG = getPaintIMG();
		if(paintIMG != null){
			Graphics2D imgGraphics = (Graphics2D)paintIMG.getGraphics();
			imgGraphics.setRenderingHints(renderingQuality);
			Font font = new Font("Verdana", Font.BOLD, 15);
			imgGraphics.setColor(new Color(0, 0, 0));
			imgGraphics.setFont(font);
			FontMetrics fm = imgGraphics.getFontMetrics(font);
			if(xpHandler != null){
				String xp = nf.format(xpHandler.getCurrentXP() - xpHandler.getStartXP());
				imgGraphics.drawString(xp, 550 - fm.stringWidth(xp), 36);
			}
			if(calcTime > 0 && xpHandler != null){
				String xphStr = nf.format(xph);
				imgGraphics.drawString(xphStr, 550 - fm.stringWidth(xphStr), 56);
			}
			imgGraphics.setColor(new Color(0, 255, 255));
			if(startTime > 0)
				imgGraphics.drawString(getRunTime(), 115, 67);
			if(xpHandler != null)
				imgGraphics.drawString(xpHandler.getCurrentLevel() + " (+" + (xpHandler.getCurrentLevel() - xpHandler.getStartLevel()) + ")", 145, 87);
			if(startTime > 0)
				imgGraphics.drawString(nf.format(bonesOffered), 145, 107);
			if(!status.isEmpty())
				imgGraphics.drawString(status, 85, 128);
			g.drawImage(paintIMG, 0, Screen.getDimension().height - paintIMG.getHeight(), null);
		}
	}
	
	private BufferedImage getPaintIMG(){
		byte data[] = DatatypeConverter.parseBase64Binary(PAINT_IMG_STR);
		InputStream in = new ByteArrayInputStream(data);
		try{
			return ImageIO.read(in);
		}catch(Exception e){
			e.printStackTrace();
		}finally{
			try{
				in.close();
			}catch(Exception e){}
		}
		return null;
	}
	
	private void buildPaintString(){
		if(!PAINT_IMG_STR.isEmpty())
			return;
		for(String str : PAINT_IMG_STR_ARR)
			PAINT_IMG_STR += str;
	}
